import React, { useState } from 'react';
import { useMemo } from 'react';
import Navigation from '../components/Navigation';
import { GoogleMap, useLoadScript, Marker } from "@react-google-maps/api";

const libraries = ['places']

const Map = () => {
    const {isLoaded, loadError} = useLoadScript({
        googleMapsApiKey: process.env.REACT_APP_GOOGLE_MAPS_API_KEY,
        libraries,
    });
    const center = useMemo(() => ({ lat: 44, lng: -80 }), []);
    const [villes, setVilles] = useState({});
    const cookiesName = 'villes';

    //setVilles(JSON.parse(localStorage.getItem(cookiesName)))

    if(loadError) return "Error loading maps : " + loadError;
    if(!isLoaded) return <div>Loading...</div>;

    return (
    <div>
        <Navigation/>
        <GoogleMap mapContainerClassName="map-container" zoom={10} center={center} zIndex={1}>
            <Marker position={{ lat: 44, lng: -80 }} zIndex={10}/>
        </GoogleMap>
    </div>
    )
};

export default Map;
